Update MongoDB with mongoose<p>I trying to update a field in <code>users</code> collection once a user is logged into the application. But the update query is not working at all.</p>

<p><strong>users.js</strong></p>

<pre><code>var express = require('express');
var router = express.Router();
var User = require('../models/user');
var jwt = require('jsonwebtoken');

router.post('/login', function(req,res,next){
   let promise = User.findOne({email:req.body.email}).exec();

    promise.then(function(doc){
      if(doc) {
        if(doc.isValid(req.body.password)){
           // generate token
           let token = jwt.sign({username:doc.username},'secret', {expiresIn : '3h'});

           setOnlineStatus(doc.username);
        } else {
           return res.status(501).json({message:' Invalid Credentials'});
        }
      } else {
         return res.status(501).json({message:'User email is not registered.'})
      }
    });

    promise.catch(function(err){
      return res.status(501).json({message:'Some internal error'});
    })
})

function setOnlineStatus(username){
   console.log(username); // log the correct username value
   User.update(
      {'username': username},
      {$set: {'status':'Online'}},
   );
}
</code></pre>

<p><strong>Model - user.js</strong></p>

<pre><code>var mongoose = require('mongoose');
var Schema = mongoose.Schema;
var bcrypt = require('bcrypt');

var schema = new Schema({
    email : {type:String, require:true},
    username: {type:String, require:true},
    password:{type:String, require:true},
    creation_dt:{type:Date, require:true}
});

schema.methods.isValid = function(hashedpassword){
   return  bcrypt.compareSync(hashedpassword, this.password);
}

module.exports = mongoose.model('User',schema);
</code></pre>

<p>So now the problem is once a request is send to <code>/login</code> service, the call to <code>setOnlineStatus()</code> is not updating <code>users</code> collection with a new field status having value 'online'.</p>

<blockquote>
  <p><strong>NOTE:</strong> Using another service <code>/register</code> users are already added to the <code>users</code> collection.</p>
</blockquote>

<p>I'm a newbie to express and mongodb. So please help me to solve this issue. 
Thank you and answers will be appreciated.</p>

