Mongodb: sort by elements in an array<p>I am working on a project and I found a request that I don't understand and is not working. We have documents that look like this:</p>

<pre><code> {
        "id": ObjectId("6457959757555445"),
        "buyer" : { 
            "id": ObjectId("588888815654684")      
            "roles" : [ 
                "BUYER"
            ]
        }
},
{
        "id": ObjectId("6457959707555445"),
        "buyer" : { 
            "id": ObjectId("588800015654684")      
            "roles" : [ 
                "ADMIN"
            ]
        }
}
</code></pre>

<p>And there is a request that should sort a collection of theses documents by roles. So for the example above, I will have <code>ADMIN</code> then <code>BUYER</code>. So here is the request:</p>

<pre><code>{  
   "aggregate":"__collection__",
   "pipeline":[  
      {  
         "$sort":{  
            "buyer.roles":1
         }
    },
}
</code></pre>

<p>Should we really use <code>pipeline</code> here? and why it is not working?</p>

