Issue upgrading to latest C# MongoDB Driver<p>I have a .NET Application that uses a MongoDB so I am using mongo c# driver.  Current version I am using is 1.9.2.</p>

<p>I am trying to update this to latest C# mongodb driver - 2.7.0.  I have had to make numerous code changes so far for breaking changes.  I am stumped with a few at the minute - may raise new questions for the others in due course but the one below has been causing the App to not even load when debugging.</p>

<p>This was my original code with the 1.9.2 driver:</p>

<pre><code>    /// &lt;summary&gt;
    /// Since the current Mongo driver does not support database side Select
    /// projections, we need to use this custom function to achieve the same.
    /// &lt;/summary&gt;
    /// &lt;param name="criteria"&gt;&lt;/param&gt;
    /// &lt;param name="fields"&gt;&lt;/param&gt;
    /// &lt;returns&gt;&lt;/returns&gt;
    public IEnumerable&lt;T&gt; Get(Expression&lt;Func&lt;T, bool&gt;&gt; criteria,
        params Expression&lt;Func&lt;T, object&gt;&gt;[] fields)
    {
        return this.Collection.FindAs&lt;T&gt;(Query&lt;T&gt;.Where(criteria)).SetFields
                 (Fields&lt;T&gt;.Include(fields));
    }
</code></pre>

<p>This is what I have attempted with the latest C# driver:</p>

<pre><code>    /// &lt;summary&gt;
    /// Since the current Mongo driver does not support database side Select
    /// projections, we need to use this custom function to achieve the same.
    /// &lt;/summary&gt;
    /// &lt;param name="criteria"&gt;&lt;/param&gt;
    /// &lt;param name="fields"&gt;&lt;/param&gt;
    /// &lt;returns&gt;&lt;/returns&gt;
    public IEnumerable&lt;T&gt; Get(Expression&lt;Func&lt;T, bool&gt;&gt; criteria,
        params Expression&lt;Func&lt;T, object&gt;&gt;[] fields)
    {
        return this.Collection.Find&lt;T&gt;(criteria).Project(Builders&lt;T&gt;.Projection.Include(FilterDefinitionBuilder&lt;T&gt;.(fields)));
    }
</code></pre>

<p>however I am getting a red build error on the .(fields))); saying incorrect primary expression but not sure what the correct fix is for this.</p>

<p><strong>UPDATE</strong></p>

<p>I added the code from mickl answer below and now when run the app I am getting the following exception:</p>

<pre><code>"An error occurred while deserializing the Id property of class MyApp.Domain.Models.EntityBase: Cannot deserialize a 'String' from BsonType 'ObjectId'."
</code></pre>

<p>I had a BsonClassRegistration class with my old C# Driver Mongo code - the original code in it was below:</p>

<pre><code>        BsonClassMap.RegisterClassMap&lt;EntityBase&gt;(cm =&gt;
        {
            cm.AutoMap();
            cm.SetIdMember(cm.GetMemberMap(x =&gt; x.Id).SetIdGenerator(StringObjectIdGenerator.Instance));
            cm.GetMemberMap(c =&gt; c.Id).SetRepresentation(BsonType.ObjectId);
        });
</code></pre>

<p>To fix this with the upgrade to the latest C# driver I changed the code to the below:</p>

<pre><code>        BsonClassMap.RegisterClassMap&lt;EntityBase&gt;(cm =&gt;
        {
            cm.AutoMap();
            cm.SetIdMember(cm.GetMemberMap(x =&gt; x.Id).SetIdGenerator(StringObjectIdGenerator.Instance));
            cm.GetMemberMap(c =&gt; c.Id).SetSerializer(new StringSerializer(BsonType.ObjectId));
        });
</code></pre>

<p>Would this be the reason for the failure I am now seeing in the Get method</p>

