How to create multiple unique data points in Mongoose schema?<p>I'm using express and with mongoose/mongo db and have a user document with 2 data points that I want to be unique (email and username). My problem is that my sign-up process is multiple steps so email is saved first then in the next step username is saved. I have a bug where if a user is between steps 1 and 2, no other users can sign up because I get the error saying that the username or email they try to save isn't unique. If the user that was between steps 1 and 2 finished then the other user can create an email and it works perfectly. What I am currently doing is compound indexing and somehow associates the2 fields. I need a solution where mongo db returns an error if it tries to save the field but there is an already existing identical piece of data in that field for another user. I already do my own checking to make sure it is unique by searching for that email and allowing the save if the search returned nothing. The problem with this is that it's async and a user could potentially submit the same email or username twice at the same time and it would create. I want to use mongo unique indexes for both fields individually (not linked in any way) so that mongo will return an error if not unique thus solving this edge case. What am I doing wrong here? How do I make these fields unique but in no way associated with one another? Here is the gist of my code:</p>

<pre><code>const UserSchema = new mongoose.Schema({
 email: {
  type: String,
  required: true,
  trim: true
},
 username: {
  type: String,
  required: false,
  trim: true
}
})

UserSchema.index({
  email: 1,
  username: 1
}, {unique: true});
</code></pre>

